import React from 'react';
import '../styles/About.css';
const About = () => {
  return (
    <section id="about">
      <h2>About Me</h2>
      <p>I am a highly skilled and versatile developer with extensive experience across multiple technologies and platforms. My expertise includes:

Front-End Technologies: Proficient in JavaScript, React, HTML, and CSS, enabling me to build dynamic and responsive user interfaces.<b></b>
Back-End Technologies: Experienced with Java, Node.js, Spring Boot, and Python, allowing me to develop robust and scalable server-side applications.
DevOps & Cloud Computing: Skilled in AWS and Docker, with a solid understanding of CI/CD pipelines and containerization for efficient deployment and management.
Scripting & Automation: Competent in Bash scripting for automating tasks and enhancing development workflows.
Security: Knowledgeable in Kali Linux and its tools, with an understanding of cybersecurity principles and practices.
I bring a comprehensive approach to software development and system engineering, combining technical proficiency with a commitment to delivering high-quality solutions.</p>
    </section>
  );
};

export default About;
